/**
 * @fileoverview added by tsickle
 * @suppress {checkTypes} checked by tsc
 */
class StoriesComponent {
    /**
     * @param {?} dialog
     * @param {?} storyService
     */
    constructor(dialog, storyService) {
        this.dialog = dialog;
        this.storyService = storyService;
    }
    /**
     * @return {?}
     */
    ngOnInit() {
        let /** @type {?} */ botId;
        if (this.bot && this.bot._id) {
            botId = this.bot._id.$oid;
        }
        this.storyService.getStories(botId).then((s) => {
            this.stories = s;
        });
    }
    /**
     * @param {?=} story
     * @return {?}
     */
    openDialog(story = null) {
        const /** @type {?} */ dialogRef = this.dialog.open(StoryDialogComponent, {
            width: '90%',
            data: { story: story }
        });
        dialogRef.afterClosed().subscribe(result => {
            console.log('The dialog was closed');
            console.log(result);
            this.ngOnInit();
        });
    }
    /**
     * @return {?}
     */
    add() {
        this.openDialog();
    }
    /**
     * @param {?} story
     * @return {?}
     */
    edit(story) {
        this.openDialog(story);
    }
    /**
     * @param {?} story
     * @return {?}
     */
    train(story) {
        const /** @type {?} */ dialogRef = this.dialog.open(TrainDialogComponent, {
            width: '99%',
            data: { story: story }
        });
        dialogRef.afterClosed().subscribe(result => {
            console.log('The dialog was closed');
            console.log(result);
        });
    }
    /**
     * @param {?} story
     * @return {?}
     */
    delete(story) {
        if (confirm('Are u sure want to delete this story?')) {
            this.storyService.deleteStory(story._id.$oid).then((s) => {
                this.ngOnInit();
            });
        }
    }
    /**
     * @param {?} story
     * @return {?}
     */
    build(story) {
        this.storyService.buildStory(story._id.$oid).then((s) => {
            this.ngOnInit();
        });
    }
}
