class TrainComponent {
    /**
     * @param {?} fb
     * @param {?} storyService
     */
    constructor(fb, storyService) {
        this.fb = fb;
        this.storyService = storyService;
        this.trainFormFields = {
            input: [''],
        };
        this.trainForm = this.fb.group(this.trainFormFields);
        this.testFormFields = {
            input: [''],
        };
        this.testForm = this.fb.group(this.testFormFields);
    }
    /**
     * @return {?}
     */
    ngOnInit() {
        console.log(this.story);
        if (this.story) {
            if (this.story._id && this.story._id.$oid) {
                this.story._id = this.story._id.$oid;
            }
        }
    }
    /**
     * @return {?}
     */
    addTest() {
    }
    /**
     * @return {?}
     */
    buildModel() {
        this.storyService.buildStory(this.story._id)
            .then(c => {
            this.message = 'Build sucessfull';
        })
            .catch(c => {
            this.message = 'Error on Building';
        });
    }
    /**
     * @return {?}
     */
    clear() {
        this.trainForm.reset();
    }
    /**
     * @return {?}
     */
    startLabeling() {
        const /** @type {?} */ form = this.trainForm.value;
        this.storyService.startLabeling(form.input)
            .then(c => {
            this.labelled = c;
            // this.message = 'Build sucessfull';
        })
            .catch(c => {
            this.message = 'Error on labelling';
        });
    }
    /**
     * @param {?} i
     * @return {?}
     */
    deleteSetence(i) {
        const /** @type {?} */ array = this.story.labeledSentences;
        array.splice(i, 1);
    }
}
